
'''
next数组里存放的是如果在该位置比较失败，回退到哪个位置跟输入串的下一个位置继续比较。
当p[i]!=p[j]的时候，如果真有字符串在此比较失败，说明只要回退到j这个位置，因为此时[0,j-1]都是相等的，而第j个位置还有可能和第i个位置相等。
而当p[i]==p[j]的时候，如果有字符串在此比较失败的话，说明尽管[0,j-1]还是相等，可是第j的位置永远不可能跟第i个位置相等了。
'''

class Solution:
    # @param haystack, a string
    # @param needle, a string
    # @return a string or None
    def strStr(self, haystack, needle):
        if not needle:
            return haystack

        next = self.getnext(needle)
        i = 0
        j = 0
        while i < len(haystack) and j < len(needle):
            if j == -1 or haystack[i] == needle[j]:
                i += 1
                j += 1
            else:
                j = next[j]

        if j >= len(needle):
            return haystack[i-len(needle):]
        return None

    def getnext(self, needle):
        next = [-1 for i in range(len(needle))]
        j = -1
        i = 0
        while i < len(needle) - 1:
            if j == -1 or needle[i] == needle[j]:
                i += 1
                j += 1
                if needle[i] != needle[j]:
                    next[i] = j
                else:
                    next[i] = next[j]
            else:
                j = next[j]

        return next
        
if __name__ == "__main__":
    s = Solution()

    assert s.strStr('abc', 'ab') == 'abc'
    assert s.strStr('abc', 'bc') == 'bc'
    assert s.strStr('abc', 'bcd') == None















